                <div className="close-div">
                    <Link className="close" to="/">
                        X
                    </Link>
                </div>
                <div className="popup-content">
                    {recipe && (
                        <div>
                            <h2>{recipe.title}</h2>
                            <h4>Ingredients:</h4>
                            <p>{recipe.ingredients}</p>
                            <h4>Directions:</h4>
                            <p>{recipe.recipeinstructions}</p>
